import { useEffect, useState } from "react";

function GetReps() {

    const [reps, setReps] = useState([])

    const getData = async () => {
        const response = await fetch('http://localhost:8090/api/salespeople/');
        if (response.ok) {
            const data = await response.json();
            setReps(data.reps)
        }
    }



    return (
        "hello world"
    );
}

export default GetReps;
